import React from "react";

function ShowList({ groceries }) {
  return (
    <div>
      <h1>This is Showing list</h1>
      <ul>
        {groceries.map((grocy) => {
          return (
            <li>
              {grocy}
              <button>X</button>
            </li>
          );
        })}
      </ul>
    </div>
  );
}

export default ShowList;
